                <th>Mail</th>
                <th>DateNaissance</th>
                <th>PwdUser</th>
                <th>RefAdmin</th>
                <th>IdLabel</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for user in users %}
            <tr>
                <td>{{ user.idUser }}</td>
                <td>{{ user.nom }}</td>
                <td>{{ user.prenom }}</td>
                <td>{{ user.username }}</td>
                <td>{{ user.mail }}</td>
                <td>{{ user.dateNaissance ? user.dateNaissance|date('Y-m-d') : '' }}</td>
                <td>{{ user.pwdUser }}</td>
                <td>{{ user.refAdmin }}</td>
                <td>{{ user.idLabel }}</td>
                <td>
                    <a href=\"{{ path('user_show', {'idUser': user.idUser}) }}\">show</a>
                    <a href=\"{{ path('user_edit', {'idUser': user.idUser}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"10\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('user_new') }}\">Create new</a>
{% endblock %}
